From PhieuThu pt
Where pt.Ngay>="',DATE_FORMAT(`@fromDate`, '%Y-%m-%d'),'" AND pt.`Ngay`<="',DATE_FORMAT(`@toDate`, '%Y-%m-%d'),'" AND  pt.`PhanLoaiThuId` IN(', `@phanloaithuids`, ') GROUP BY pt.Ngay, `pt`.`PhanLoaiThuId`');

