INNER JOIN (SELECT * FROM hocsinh_lop hl ORDER BY DateCreated DESC) AS hl ON vbtt.HocSinhId = hl.HocSinhId 

INNER JOIN hocsinh h ON vbtt.HocSinhId=h.HocSinhId

WHERE YEAR(vbtt.`NgayTinh`) = YEAR(ngay) AND MONTH(vbtt.`NgayTinh`) = MONTH(ngay) AND (lop IS NULL OR vbtt.`LopId` = lop) AND h.ThoiHoc=0

