CREATE PROCEDURE `insertUserPrivilegeIfNotExists`(IN `@userid` INT, IN `@privilegeid` INT, IN `@value` INT)
    MODIFIES SQL DATA
BEGIN IF (NOT EXISTS (SELECT * FROM `user_privilege` WHERE UserId=`@userid` AND PrivilegeId=`@privilegeid`)) THEN INSERT INTO `user_privilege`(`UserId`, `PrivilegeId`, `Value`) VALUES (`@userid`, `@privilegeid`, `@value`); ELSE UPDATE `user_privilege` SET Value=`@value` WHERE UserId=`@userid` AND PrivilegeId=`@privilegeid`; END IF; END |
DELIMITER ;

